    else if (ast.getType() == TokenTypes.IMPORT) {
        final FullIdent imp = FullIdent.createFullIdentBelow(ast);
        if (isFromPackage(imp.getText(), "java.lang")) {
            log(ast, MSG_LANG, imp.getText());
